import React from 'react';
import InventoryItem from './InventoryItem';

const InventoryFrame = () => {
    return (
        <>
            <InventoryItem />
            <InventoryItem />
            <InventoryItem />
            <InventoryItem />
        </>
    )
}

export default InventoryFrame;
